def numSubarrayProductLessThanK( nums: 'List[int]', k: int):
    cnt_arr_left = []
    curr = 1
    i, j  = 0, 0
    while j < len(nums):
        if nums[j] >= k:
            cnt_arr_left.append(0)
            curr = 1
            i=j+1
        else:
            curr *= nums[j]
            if curr < k:
                cnt_arr_left.append(j-i+1)
            else:
                while i < j:
                    curr /= nums[i]
                    if curr < k:
                        i+=1
                        cnt_arr_left.append(j-i+1)
                        break
                    else:
                        i+=1

        j+=1

    return sum(cnt_arr_left)


